import React, { useState, useEffect } from 'react';
import axios from 'axios';

export default function DeveloperList() {
    const [developers, setDevelopers] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:8000/api/devs')
            .then(response => {
                setDevelopers(response.data);
            })
            .catch(error => console.error('Erro ao buscar dados:', error));
    }, []);

    return (
        <div>
            <h1>Lista de Desenvolvedores</h1>
            {developers.length > 0 ? (
                developers.map(dev => (
                    <div key={dev.id}>
                        <h2>{dev.name} ({dev.nickname})</h2>
                        <p>Data de Nascimento: {dev.birth_date}</p>
                        <p>Conhecimento Tecnol√≥gica: {dev.stack ? dev.stack.join(', ') : 'Nenhum'}</p>
                    </div>
                ))
            ) : (
                <p>Nenhum desenvolvedor encontrado.</p>
            )}
        </div>
    );
}
